🙌 Вчера, 18 февраля, в нашем колледже состоялась встреча с руководителем «Молодой Гвардии" г.о.Тольятти  [id188384898|Яной Ковыльской]. 
Яна Ивановна побеседовала со студентами в дружеской атмосфере и в свою очередь рассказала:

✔️о масштабной всероссийской общественной организации "Молодая гвардия Единой России", активно поддерживаемой губернатором Самарского региона Вячеславом Андреевичем Федорищевым;

✔️о своём опыте поездки с ГУМАНИТАРНОЙ МИССИЕЙ в Донецкую народную республику;

✔️о планах и мероприятиях молодогвардейцев г.Тольятти на ближайший месяц;

✔️о ФОРУМЕ ПЕРВИЧНЫХ ОТДЕЛЕНИЙ МГЕР федерального уровня, который пройдет в Тольятти 11 марта 2025 года;

✔️о молодёжном образовательном проекте "ШКОЛА ЛИДЕРСТВА", четвертое занятие которого состоялось в субботу 15 февраля. На занятиях самые яркие представители учебных заведений города принимают участие в диалоге на равных с Лидерами различных направлений (политиками, бизнесменами, активистами), а также знакомятся между собой, обмениваются опытом и находят единомышленников!

🇷🇺 [club173000963|«Молодая Гвардия Единой России» г.о.Тольятти]
